import "./navbar.css"
import React from 'react';

import Data from '../cards/data'
import Details from '../cards/details';
import {
  BrowserRouter,
  Switch,
  Route
} from "react-router-dom";


export default function Navbar() {


  return (



      <BrowserRouter>
        <Switch>

          <Route path="/" >
            <Data/>
          </Route>


          <Route path="/deatils" >
            <Details />
          </Route>


        </Switch>
      </BrowserRouter>



  )

}
